} This basically says that the identity function takes an argument of type Type and that its return type is of the same type as the argument. Now we get proper type inference: let val = 'Hello, world!';
let val2 = identity<string>(val); // val2 is of type string We dont actually have to manually specify the type string when calling the function and can instead rely on TypeScripts inference: let val = 'Hello, world!';
let val2 = identity(val); // val2 is of type string There is no single convention for naming type parameters. Common names includew T, Type and TType.

