The keyof type operator takes an object type and produces a literal union of its keys. For example: type User = { name: string; email: string; age: number };
type UserKeys = keyof User; // UserKeys is equivalent to "name" | "email" | "age" The keyof type operator is particularly useful with generics. Consider the following example: function getProperty<Type, Key>(obj: Type, key: Key) { return obj[key];
} This will not compile because we have no idea if key can be used to index into obj so you will get the following error: index.ts:2:10 - error TS2536: Type 'Key' cannot be used to index type 'Type'.
2 return obj[key]; ~~~~~~~~
Found 1 error in index.ts:2 Therefore we need to specify that Key should be of a type that can be used to index into an object of type Type. In other words, Key should extend keyof Type: function getProperty<Type, Key extends keyof Type>(obj: Type, key: Key) { return obj[key];
}
